import React from 'react';
import classes from './Profile.module.css';
import Person from './components/Footer/Footer';

const Profile = () => {
    return (
        <div className={classes.content}>
        <div>
          <img src='https://arabiatravelnews.com/wp-content/uploads/2021/12/japan-1200x729-1.jpg'></img>
        </div>
        <PersonInfo />



        <div>
          my post
        </div>
        <div>
          new post
          </div>
        <div>
          post 1
          </div>
        <div>
          post 2
          </div>
      </div>
    );
}
export default Profile;
